	add("clickability", "{\"term\":\"clickability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027c.\u0027 1970 (manufacturing), \u0027c.\u0027 1990 (computing) {{suffix|clickable|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being clickable, of causing a particular action when clicke\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The ability of a foam to retain its original shape after cutting, without deformation or burr\", \"priority\":2}]}, \"synonyms\":{}}");

	add("clickbait", "{\"term\":\"clickbait\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|click|bait|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Website content that is aimed at generating advertising revenue, especially at the expense of quality or accuracy, relying on sensationalist headlines to attract click-throughs; such headlines\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Gideon Haigh, \u0027The Deserted Newsroom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fairfax\u0027s sites are renowned for what is sometimes called ‘\u0027\u0027clickbait\u0027\u0027’: headlines written to beguile passing eyeballs but which obscure nondescript or irrelevant stories\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, \u0027The Observer\u0027, 29 Sep 2013\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;His careful lawyerly writing would be out of fashion now\u0026quot;, wrote one commenter after Kettle\u0027s piece. \u0026quot;It wasn\u0027t \u0027\u0027clickbait\u0027\u0027\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("client", "{\"term\":\"client\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027clyent\u0027 from Latin {{m|la|cliēns}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A customer, a buyer or receiver of goods or services\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The role of a computer application or system that requests and/or consumes the services provided by another having the role of server\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Person who receives help or advice from a professional person (ex. a lawyer, an accountant, a social worker, a psychiatrist, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dI corralled the judge, and we started off across the fields. And thus we came by a circuitous route to Mohair,. My \u0027\u0027client\u0027\u0027 welcomed the judge […] and they disappeared together into the Ethiopian card-room, which was filled with the assegais and exclamation point shields Mr. Cooke had had made at the sawmill at Beaverton\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who employs or retains an attorney to represent him or her in any legal matter, or one who merely divulges confidential matters to an attorney while pursuing professional assistance without subsequently retaining the attorney\", \"priority\":5}]}, \"synonyms\":{}}");

