	add("clift", "{\"term\":\"clift\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Variant form of \u0027\u0027 influenced by \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cliff\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, I.xi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So downe he fell, as an huge rockie \u0027\u0027clift\u0027\u0027, / Whose false foundation waues haue washt away\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1624\u0027\u0027, John Smith, \u0027Generall Historie\u0027, in Kupperman 1988, p. 91\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"so broad is the bay here, we could scarce perceive the great high \u0027\u0027clifts\u0027\u0027 on the other side: by them we Anchored that night and called them Riccards Cliftes\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cliffhanger", "{\"term\":\"cliffhanger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|cliff|hanger|lang\u003den}}, evoking the image of someone left hanging from a cliff, thereby having an uncertain fate.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ending or stopping point calculated to leave a story unresolved, in order to create suspense\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Hilary Hylton, \u0026quot;[http://www.time.com/time/arts/article/0,8599,1639352,00.html Filming Texas in a Good Light],\u0026quot; \u0027Time\u0027, 2 Jul\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Back in the early 80s, the hit series Dallas kept the nation guessing with its season-ending \u0027\u0027cliffhanger\u0027\u0027 \u0026quot;Who Shot J.R.?\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An outcome which is awaited with keen anticipation, especially one which is delayed for a period of time or which is not known until the last minute\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Timothy Garton Ash, \u0026quot;[http://www.guardian.co.uk/commentisfree/2008/feb/28/russia.eu?gusrc\u003drss\u0026amp;feed\u003dnetworkfront Russia has run rings round the west],\u0026quot; \u0027Guardian\u0027 (UK), 28 Feb. (retrieved 2 Feb. 2009\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This presidential election is such a \u0027\u0027cliffhanger\u0027\u0027. Will it be the rising star Dmitry \u0026quot;Obamovich\u0026quot; Medvedev? Or the veteran Gennady \u0026quot;McCainovich\u0026quot; Zyuganov\", \"priority\":6}]}, \"synonyms\":{}}");

	add("cliffing", "{\"term\":\"cliffing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the formation of cliff\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Maurice L. Schwartz, \u0027Encyclopedia of coastal science\u0027, Springer, page 613\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cliffing\u0027\u0027 of this kind is repaired if there is an abundant supply of sediment to restore the profile, permitting mangroves to spread again, but if there is a sediment deficit a mangrove cliff will persist and recede until the mangrove terrace has been completely removed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, K. Bharatdwaj, \u0027Physical Geography: Hydrosphere\u0027, Discovery Publishing House, page 157\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"When the alternate bands of hard and soft rock dip upstream in the longitudinal course of the river and if the caprock is resistant the underlying soft rocks are eroded more rapidly due to \u0027\u0027cliffing\u0027\u0027 and thus the resistant rock beds form precipituous wall-like scarps which allow the river water to fall downstram vertically and ultimately a stupendous waterfall is formed\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Eric C. F. Bird, \u0027Coastal Geomorphology: An Introduction\u0027, John Wiley and Sons\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Cliffing\u0027\u0027 (scarping) of the seaward margins of coastal dunes and the absence of new fore dunes (or the formation of new fore dunes lasting at most a few years) is very widespread around the world’s coastline, a consequence of the modern prevalence of beach erosion (Figure 9.2\", \"priority\":7}]}, \"synonyms\":{}}");

	add("clime", "{\"term\":\"clime\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular region as defined by its weather or climate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After working hard all of his life, Max retired to warmer climes in Florida\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1764\u0027\u0027, \u0027, or a Prospect of Society\u0027, [https://books.google.co.uk/books?id\u003djRxcAAAAcAAJ\u0026amp;pg\u003dPA9 page\u0026amp;nbsp;9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"My ſoul turn from them, turn we to ſurvey\u0026lt;br\u0026gt;Where rougher \u0027\u0027climes\u0027\u0027 a nobler race diſplay\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Climate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A change of clime was exactly what the family needed\", \"priority\":6}]}, \"synonyms\":{}}");

	add("climacophobia", "{\"term\":\"climacophobia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Ancient greek (to 1453) \u0027κλῖμαξ\u0027 (ladder, staircase) + \u0027-phobia\u0027 from Latin from Ancient greek (to 1453) \u0027φόβος\u0027 (fear)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fear of staircases or of falling down stairs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, \u0027\u0027, 05:46-05:51\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Lucy:\u0026lt;/span\u0026gt; Are you afraid of staircases? If you are, then you have \u0027\u0027climacophobia\u0027\u0027.\u0026lt;br /\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Natalie Kristina Goldstraw, \u0026quot;Phobos\u0026quot;, in \u0027Superlative: Echoes of the Postmodern Condition\u0027, Trafford Publishing (2004), ISBN 1412021049, [http://books.google.com/books?id\u003dBg0jXmR7-HIC\u0026amp;pg\u003dPA103\u0026amp;dq\u003d%22climacophobia%22 page 103\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I once knew a tall kyphophobic man\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Who was sick of stooping so low\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Sadly he developed \u0027\u0027climacophobia\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"When he moved from his bungalow\", \"priority\":8}]}, \"synonyms\":{}}");

	add("climate", "{\"term\":\"climate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027climat\u0027 from Latin \u0027clima\u0027 from Ancient greek (to 1453) \u0027κλίμα\u0027 (inclination) from \u0027κλίνω\u0027 (to slope, incline) (from which also \u0027cline\u0027 , from Proto-indo-european {{m|ine-pro|*ḱley-}} (English \u0027lean\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An area of the earth\u0027s surface between two parallels of latitude\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A region of the Earth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The long-term manifestations of weather and other atmospheric conditions in a given area or country, now usually represented by the statistical summary of its weather conditions during a period long enough to ensure that representative values are obtained (generally 30 years\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The context in general of a particular political, moral etc. situation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Industries that require a lot of fossil fuels are unlikely to be popular in the current political \u0027\u0027climate\", \"priority\":5}]}, \"synonyms\":{}}");

	add("climategate", "{\"term\":\"climategate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|climate|gate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scandal involving the theft of computer records in November, 2009 which contained information about climate change research conducted at the University of East Anglia (UEA) in Norwich, England\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Laura Blenkinsop, \u0026quot;[http://www.nationalpost.com/story.html?id\u003d2331832 \u0027Climategate\u0027: A primer on the email scandal]\u0026quot;, \u0027National Post\u0027, 11 December 2009\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Over the Copenhagen climate conference lies the shadow of “\u0027\u0027Climategate\u0027\u0027,” emails and documents hacked from a server at the Climatic Research Unit at the University of East Anglia in England\", \"priority\":3}]}, \"synonyms\":{}}");

