	add("climax", "{\"term\":\"climax\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|clīmax}}, from Ancient greek (to 1453) {{m|grc|κλῖμαξ||ladder, staircase, [\u0027rhetorical\u0027] climax}}, from {{m|grc|κλίνω||I lean, slant}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rhetorical device in which a series is arranged in ascending order\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1589\u0027\u0027, George Puttenham, \u0027The arte of English poesie\u0027, Pt.\u0026amp;nbsp;iii, Ch.\u0026amp;nbsp;xix, l.\u0026amp;nbsp;173\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A figure which... by his Greeke and Latine originals... may be called the marching figure... it may as aswell be called the clyming figure, for \u0027\u0027Clymax\u0027\u0027 is as much to say as a ladder\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An instance of such an ascending series\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1781\u0027\u0027, John Moore, \u0027A view of society and manners in Italy\u0027, Vol.\u0026amp;nbsp;I, Ch.\u0026amp;nbsp;vi, p.\u0026amp;nbsp;63\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Expressions for the whole \u0027\u0027Climax\u0027\u0027 of sensibility\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A culmination or acme: the last term in an ascending series, \u0027particularly\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1789\u0027\u0027, \u0027Trifler\u0027, 448, No. XXXV\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In the accomplishment of this, they frequently reach the \u0027\u0027climax\u0027\u0027 of absurdity\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The final term of a rhetorical climax\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1856\u0027\u0027, Ralph Waldo Emerson, \u0027English Traits\u0027, Ch.\u0026amp;nbsp;ix, p.\u0026amp;nbsp;147\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"When he adds epithets of praise, his \u0027\u0027climax\u0027\u0027 is ‘so English’. \u0026lt;!--linked from plagioclimax--\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The culmination of ecological development, a stage at which point various communities of organisms are in relative equilibrium with their environment and are capable of indefinite self-perpetuation under existing conditions\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1915 July 17\u0027\u0027, \u0027Bulletin of the Illinois State Laboratory\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The succession of associations leading to a \u0027\u0027climax\u0027\u0027 represents the process of adjustment to the conditions of stress, and the \u0027\u0027climax\u0027\u0027 represents a condition of relative equilibrium. \u0027\u0027Climax\u0027\u0027 associations... are the resultants of certain climatic, geological... conditions\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"lt;!--not slang--\u0026gt; The culmination of sexual intercourse, an orgasm\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Marie Carmichael Stopes, \u0027Married love\u0027, 50\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"In many cases the man\u0027s \u0027\u0027climax\u0027\u0027 comes so swiftly that the woman\u0027s reactions are not nearly ready\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The culmination of a narrative\u0027s rising action, the turning point\", \"priority\":19}]}, \"synonyms\":{}}");

