	add("clitic", "{\"term\":\"clitic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A morpheme that functions like a word, but never appears as an independent word, instead being always attached to a following or preceding word (or, in some cases, within a surrounding word\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In English, the possessive -\u0027s\u0027 is a \u0027\u0027clitic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Raffaella Zanuttini, \u0027Negation and Clausal Structure\u0027, Oxford Studies in Comparative Syntax, [http://books.google.com.au/books?id\u003dAOpwbxbZi3wC\u0026amp;pg\u003dPA29\u0026amp;dq\u003d%22clitic%22%7C%22clitics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dIlO-U-CtGoTVkAWV7IGgBg\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22clitic%22%7C%22clitics%22\u0026amp;f\u003dfalse page 29\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In fact, even within the northern Italian dialects, subject \u0027\u0027clitics\u0027\u0027 do not constitute a syntactically uniform class, as has been convincingly argued in Poletto\u0027s work\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Olga Mišeska Tomić, \u0027Balkan Sprachbund Morpho-Syntactic Features\u0027, [http://books.google.com.au/books?id\u003dMFWOYUHULgsC\u0026amp;pg\u003dPA242\u0026amp;dq\u003d%22clitic%22%7C%22clitics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dIlO-U-CtGoTVkAWV7IGgBg\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22clitic%22%7C%22clitics%22\u0026amp;f\u003dfalse page 242\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In Macedonian, \u0027\u0027clitic\u0027\u0027-doubling is a fully-fledged phenomenon. The Macedonian Dat and Acc pronominal \u0027\u0027clitics\u0027\u0027, which originate in agreement phrases and move to preverbal position,\u0026lt;sup\u0026gt;10\u0026lt;/sup\u0026gt; where they cluster with other clausal \u0027\u0027clitics\u0027\u0027, are on their way to becoming mere case markers, which formally distinguish direct and indirect objects from subjects\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Philippe Prévost, \u0027The Acquisition of French\u0027, Language Acquisition and Language Disorders: 51, [http://books.google.com.au/books?id\u003d2GMwwpTIPQQC\u0026amp;pg\u003dPA196\u0026amp;dq\u003d%22clitic%22%7C%22clitics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dIlO-U-CtGoTVkAWV7IGgBg\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22clitic%22%7C%22clitics%22\u0026amp;f\u003dfalse page 196\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Here, we will see that they also have problems with overt pronouns, especially object \u0027\u0027clitics\u0027\u0027, whose emergence is more delayed than in typically developing children\", \"priority\":11}]}, \"synonyms\":{}}");

