	add("clitoris", "{\"term\":\"clitoris\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|κλειτορίς}}, a diminutive of uncertain origin, probably from {{m|grc|κλείω||I sheathe, shut}}, in reference to its being covered by the labia minora.The related noun form {{m|grc|κλείς}} has a second meaning of \u0026quot;a key, a latch or hook (to close a door).\u0026quot; Wooden pegs were the original keys; a connection also revealed in Latin {{m|la|clavis||nail}} and {{m|la|claudere||to shut}} (see clos. Verb|close). Some medical sources give a supposed Greek verb {{m|grc|κλειτοριάζω||touch or titillate lasciviously, tickle}} literally \u0026quot;to be inclined (toward pleasure)\u0026quot; (compare German {{m|de|Kitzler||clitoris|lit\u003dtickler}}, related to Greek {{m|grc|κλειτύς}}, a variant of {{m|grc|κλιτύς||hillside}}, related to {{m|grc|κλίνω||I slope}}, from the same root as {{m|grc|κλῖμαξ||ladder}}. But many sources take {{m|grc|κλειτορίς}} literally as Ancient Greek \u0026quot;little hill\u0026quot;. Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sensitive elongated erectile organ at the anterior part of the vulva in female mammals, homologous with the penis\", \"priority\":1}]}, \"synonyms\":{}}");

